import React from 'react';
import './App.css';
import { Labels } from './Components/LabelComponent/LabelComponent';
import { Game } from './Components/GameComponent/GameComponent';

export class App extends React.Component {

  render(){
    this.state ={
      score:1
    }

    return (
      <div className="App">
          <Labels score={this.state.score}/>
          <Game numberOfHoles={6}/>
      </div>
    );
  }
}
